    for knowing the exact current boundary locations as described within the California
    Code of Regulations, Title 14, Section 307Tree Squirrel 307(a):(a) General Season
    and Areas:The general season in the counties of Alameda, Alpine, Amador, Butte,
    Calaveras, Colusa, Contra Costa, Del Norte, El Dorado, Fresno, Glenn, Humboldt,
    Kings, Lake, Lassen, Madera, Marin, Mariposa, Mendocino, Merced, Modoc, Monterey,
    Napa, Nevada, Placer, Plumas, Sacramento, San Benito, San Luis Obispo, San Joaquin,
    San Mateo, Santa Clara, Santa Cruz, Shasta, Sierra, Siskiyou, Solano, Sonoma, Stanislaus,
    Sutter, Tehama, Trinity, Tulare, Tuolumne, Yolo, Yuba, and that portion of Kern
    County lying east of Interstate 5 shall open on the second Saturday in September
    extending through the lastSunday in January.Tree Squirrel 307(b):(b) Archery and
    Falconry Tree Squirrel Season and Area: Tree squirrels may be taken with bow and
    arrow or raptors only during the general tree squirrel season and as follows:(1)
